//Store deployment errors

package it.bridge.objects;

public class ParamDepErrors {
	
	private String ERR_CODE;
	private String ERR_DESC;
	private String ERR_CATEGORY;
	
	public ParamDepErrors() {
		// TODO Auto-generated constructor stub
	}

	public String getERR_CODE() {
		return ERR_CODE;
	}

	public void setERR_CODE(String eRR_CODE) {
		ERR_CODE = eRR_CODE;
	}

	public String getERR_DESC() {
		return ERR_DESC;
	}

	public void setERR_DESC(String eRR_DESC) {
		ERR_DESC = eRR_DESC;
	}

	public String getERR_CATEGORY() {
		return ERR_CATEGORY;
	}

	public void setERR_CATEGORY(String eRR_CATEGORY) {
		ERR_CATEGORY = eRR_CATEGORY;
	}

}
